import React, { useState, useEffect } from "react";
import { useParams, useNavigate, useLocation } from "react-router-dom";
import Split from "react-split";
import MonacoEditor from "@monaco-editor/react";
import "./SolveProblemPage.css";

function SolveProblemPage({ problems, userInfo }) {
  const { problemId } = useParams();
  const navigate = useNavigate();
  const location = useLocation();
  const problem = problems.find((p) => String(p.id) === String(problemId)) || {};

  const [testCaseResults, setTestCaseResults] = useState([null, null, null, null, null]);
  const [tab, setTab] = useState("description");
  const [code, setCode] = useState("// Write your code here...");
  const [language, setLanguage] = useState("python");
  const [customInput, setCustomInput] = useState("");
  const [runMessage, setRunMessage] = useState("");
  const [customOutput, setCustomOutput] = useState("");
  const [isDisqualified, setIsDisqualified] = useState(false); // State for malpractice

  const example = problem.example || { input: "1 2", output: "3" };

  // --- Exam Mode and Malpractice Detection ---
  useEffect(() => {
    // 1. Enter Full-Screen on component mount if in exam mode
    if (location.state?.examMode) {
      const element = document.documentElement;
      if (element.requestFullscreen) {
        element.requestFullscreen().catch(err => {
          console.error(`Error attempting to enable full-screen mode: ${err.message} (${err.name})`);
        });
      }
    }

    // 2. Malpractice event handler
    const handleMalpractice = () => {
      // If the user is no longer in full-screen, flag them.
      if (!document.fullscreenElement) {
        setIsDisqualified(true);
        console.warn("Malpractice detected: User exited full-screen or switched tabs.");
      }
    };

    // 3. Add listeners
    document.addEventListener("fullscreenchange", handleMalpractice);
    window.addEventListener("blur", handleMalpractice); // Detects tab/window switching

    // 4. Cleanup listeners on component unmount
    return () => {
      document.removeEventListener("fullscreenchange", handleMalpractice);
      window.removeEventListener("blur", handleMalpractice);

      // *** THE FIX IS HERE ***
      // Only attempt to exit full-screen if the document is still in full-screen mode.
      if (document.fullscreenElement && document.exitFullscreen) {
        document.exitFullscreen();
      }
    };
  }, [location.state]);


  const handleRun = () => { /* ... existing logic */ };
  const handleRunCustom = () => { /* ... existing logic */ };
  const handleSubmit = () => { /* ... existing logic */ };

  // Render a disqualification overlay if malpractice is detected
  if (isDisqualified) {
    return (
      <div className="disqualified-overlay">
        <h2>Malpractice Detected</h2>
        <p>You have been disqualified for leaving the full-screen mode.</p>
        <p>Your session has been terminated.</p>
        <button className="back-btn" onClick={() => navigate("/")}>Return to Dashboard</button>
      </div>
    );
  }

  return (
    <div className="solve-problem-page-root">
      <Split
        className="split-panel"
        sizes={[46, 54]}
        minSize={320}
        gutterSize={6}
        cursor="col-resize"
      >
        {/* LEFT PANEL */}
        <div className="left-question-panel">
          <h2>{problem.title}</h2>
          <div className={`difficulty-badge ${problem.difficulty?.toLowerCase()}`}>{problem.difficulty}</div>
          <div className="panel-tabs">
            <button className={tab === "description" ? "active" : ""} onClick={() => setTab("description")}>Description</button>
            <button className={tab === "examples" ? "active" : ""} onClick={() => setTab("examples")}>Examples</button>
            <button className={tab === "testcases" ? "active" : ""} onClick={() => setTab("testcases")}>Test Cases</button>
            <button className={tab === "custom" ? "active" : ""} onClick={() => setTab("custom")}>Custom Input</button>
          </div>
          <div className="panel-tabpane">
            {/* ... Your existing tab content ... */}
          </div>
        </div>
        {/* RIGHT PANEL */}
        <div className="right-editor-panel">
          {/* ... Your existing editor panel content ... */}
        </div>
      </Split>
    </div>
  );
}

export default SolveProblemPage;
